void back(int pos , int credCnt , int coursCnt, int m1, int m2, int m3){
	if(pos == (int)S.size() ){
		if(credCnt >= minCreds && coursCnt >= minCours){
			/*
			cout << "esc : ";
			for(auto x : currentCCS) cout << x << " ";
			cout << endl;
			*/
			allSolutions.push_back(currentCCS);
			creditsCnt.push_back(credCnt);
			coursesCnt.push_back(coursCnt);
			//agregar obligatoriedad por curso
		}
		return;
	}
	//branching(not implemented yet)
	int idCourse = C[pos];
	if(!IsOblig[pos]) back(pos + 1, credCnt , coursCnt,m1,m2,m3);
	
	for(int i = 0 ; i < (int)S[pos].size(); ++i){
		int idCCS = S[pos][i];
		int nm1 = CourseSection_Mask[idCCS][0];
		int nm2 = CourseSection_Mask[idCCS][1] ;
		int nm3 = CourseSection_Mask[idCCS][2] ;
		int cred = Course_Credits[idCourse];
		if( !(m1 & nm1) && !(m2 & nm2) && !(m3 & nm3) && credCnt + cred <= maxCreds && coursCnt + 1 <= maxCours ){
			//pon
			currentCCS.push_back(idCCS);
			//
			back(pos + 1,credCnt + cred,coursCnt + 1, m1|nm1 , m2|nm2 , m3|nm3 );
			//quita
			currentCCS.pop_back();
			//
		}
	}
}
string formatString(int len, string s){
	//return s;
	int cur = 0;
	for(auto x : s) if(int(x) < 0) cur ++;
	return string(len - (int)s.size() + cur/2,' ') + s;
}
void fix(vector<string> &v){
	sort(v.begin(),v.end());
	v.resize(unique(v.begin(),v.end()) - v.begin());
}
